  \\\\(f\\\\) = \\\\(\\\\frac{40}{20}\\\\) = \\\\(2\\\\) \\\\(Hz\\\\).</div>\\n\",\"introduction\":\"\"},\"keywords\":[{\"options\":{\"points\":1,\"occurrences\":1,\"caseSensitive\":true,\"forgiveMistakes\":false,\"feedbackIncludedWord\":\"keyword\",\"feedbackMissedWord\":\"none\"},\"keyword\":\"2\",\"alternatives\":[\"two\"]}],\"overallFeedback\":[{\"from\":0,\"to\":100}],\"behaviour\":{\"inputFieldSize\":\"1\",\"enableRetry\":true,\"ignoreScoring\":false,\"pointsHost\":1,\"linebreakReplacement\":\" \"},\"checkAnswer\":\"Check\",\"tryAgain\":\"Retry\",\"showSolution\":\"Show solution\",\"feedbackHeader\":\"Feedback\",\"solutionTitle\":\"Sample solution\",\"remainingChars\":\"Remaining characters: @chars\",\"notEnoughChars\":\"You must enter at least @chars characters!\",\"messageSave\":\"saved\",\"ariaYourResult\":\"You got @score out of @total points\",\"ariaNavigatedToSolution\":\"Navigated to newly included sample solution after textarea.\",\"taskDescription\":\"<p>2. Calculate the frequency of oscillations.</p>\\n\",\"submitAnswer\":\"Submit\",\"ariaCheck\":\"Check the answers.\",\"ariaShowSolution\":\"Show the solution. You will be provided with a sample solution.\",\"ariaRetry\":\"Retry the task. You can improve your previous answer if the author allowed that.\"},\"library\":\"H5P.Essay 1.5\",\"metadata\":{\"contentType\":\"Essay\",\"license\":\"U\",\"title\":\"Untitled Essay\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Untitled Essay\"},\"subContentId\":\"951542a8-1486-449f-aa3d-80e4284e8f43\"},\"useSeparator\":\"disabled\"},{\"content\":{\"params\":{\"media\":{\"disableImageZooming\":false},\"solution\":{\"sample\":\"<div>Period is the time needed for 1 complete oscillation</div>\\n\\n<div>Frequency is given by the relation \\\\(f\\\\) = \\\\(\\\\frac{1}{T}\\\\)  \\\\(T\\\\) = \\\\(\\\\frac{1}{f}\\\\) =\\\\(\\\\frac{1}{2}\\\\) = 0.5 s.</div>\\n\",\"introduction\":\"\"},\"keywords\":[{\"options\":{\"points\":1,\"occurrences\":1,\"caseSensitive\":true,\"f
